// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";
import "../interfaces/IUsageFacet.sol";
import "../interfaces/IKIP7.sol";
import "../utils/math/SafeMath.sol";

contract UsageFacet is IUsageFacet {

    using SafeMath for uint256;

    string constant VFINIX_SERVICE = "vFinix.service";
    string constant VFINIX_SERVICE_USE = "vFinix.service_use";
    string constant VFINIX_TOTAL_USE = "vFinix.total_use";
    string constant VFINIX_SERVICE_ALLOWANCE = "vFinix.service_allowance";

    function approveToService(bytes32 _serviceId, uint256 _amount) public {
        bytes32 allowanceKey = keccak256(abi.encode(VFINIX_SERVICE_ALLOWANCE, msg.sender, _serviceId));
        LibDiamond.setUint(allowanceKey, _amount);
    }

    function getServiceAllowance(bytes32 _serviceId, address _holder) public view returns (uint256) {
        return LibDiamond.getUint(keccak256(abi.encode(VFINIX_SERVICE_ALLOWANCE, _holder, _serviceId)));
    }

    // register services by integrating contract
    function registerService(address _serviceContract, bytes32 _serviceId, string calldata _serviceName) external override{
        LibDiamond.enforceIsContractOwner();
        bytes32 serviceKey = keccak256(abi.encode(VFINIX_SERVICE, _serviceContract, _serviceId));
        // Service must not been register before.
        require(LibDiamond.getBool(serviceKey) == false,"vFinix: Service's already been registered");
        // Locate storage
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        uint16 serviceCount = uint16(ds.services.length);
        // Map New Service to index
        LibDiamond.setUint(serviceKey,uint256(serviceCount));
        // Mapping existing of service
        LibDiamond.setBool(serviceKey,true);
        // Create new Service
        LibDiamond.Service memory newService = LibDiamond.Service(
            _serviceContract,
            _serviceId,
            _serviceName
        );
        // // Add new Service
        ds.services.push(newService);
    }

    function getTotalVotes(address _holder) external override view returns(uint256 totalVotes_) {
        totalVotes_ = IKIP7(address(this)).balanceOf(_holder);
    }

    function getAvailableVotes(address _holder) external override view returns(uint256 availableVotes_) {
        return _getAvailableVotes(_holder);
    }
    function getTotalUsingVotes(address _holder) external override view returns(uint256 totalUsingVote_) {
        return _getTotalUsingVotes(_holder);
    }

    function addVotesToService(bytes32 _serviceId, address _holder, uint256 _amount) external override {
        bytes32 serviceKey = keccak256(abi.encode(VFINIX_SERVICE, msg.sender, _serviceId));
        require(LibDiamond.getBool(serviceKey) == true, "vFinix: Service does not exists");

        // Total votes
        uint256 availableVotes = _getAvailableVotes(_holder);
        require(availableVotes >= _amount, "vFinix: Not enough available Votes");

        // Get holder allowance
        bytes32 allowanceKey = keccak256(abi.encode(VFINIX_SERVICE_ALLOWANCE, _holder, _serviceId));
        uint256 holderAllowance = LibDiamond.getUint(allowanceKey);
        require(holderAllowance >= _amount, "vFinix: Amount exceed allowance");

        // Set total using votes
        uint256 usingVotes = _getTotalUsingVotes(_holder);
        _setTotalUsingVotes(_holder, usingVotes.add(_amount));

        // Set using on service
        uint256 usingServiceVotes = _getVotesOnService(msg.sender, _serviceId,_holder);
        _setVotesOnService(msg.sender, _serviceId, _holder, usingServiceVotes.add(_amount));

        // Subtract from holder allowance
        LibDiamond.setUint(allowanceKey, holderAllowance.sub(_amount));
    }

    function removeVotesFromService(bytes32 _serviceId,address _holder, uint256 _amount) external override {
        bytes32 serviceKey = keccak256(abi.encode(VFINIX_SERVICE,msg.sender,_serviceId));
        require(LibDiamond.getBool(serviceKey) == true,"vFinix: Service does not exists");

        // Check wether how many votes on the services
        uint256 votesOnService = _getVotesOnService(msg.sender, _serviceId, _holder);
        require(votesOnService >= _amount , "vFinix: not enough Votes on service to remove");

        // Set total using votes
        uint256 usingVotes = _getTotalUsingVotes(_holder);
        _setTotalUsingVotes(_holder, usingVotes.sub(_amount));

        // Set using on service
        _setVotesOnService(msg.sender, _serviceId, _holder, votesOnService.sub(_amount));
    }

    function getVotesOnService(address _serviceContract,bytes32 _serviceId,address _holder) external override view returns(uint256) {
        return _getVotesOnService(_serviceContract, _serviceId, _holder);
    }

    function _setVotesOnService(address _serviceContract,bytes32 _serviceId,address _holder,uint256 _amount) internal {
        bytes32 usingServiceKey = keccak256(abi.encode(VFINIX_SERVICE_USE,_serviceContract,_serviceId,_holder));
        LibDiamond.setUint(usingServiceKey,_amount);
    }

    function _getVotesOnService(address _serviceContract,bytes32 _serviceId,address _holder) internal view returns(uint256) {
        bytes32 usingServiceKey = keccak256(abi.encode(VFINIX_SERVICE_USE,_serviceContract,_serviceId,_holder));
        return LibDiamond.getUint(usingServiceKey);
    }

    function _getAvailableVotes(address _holder) internal view returns(uint256 availableVotes_) {
        uint256 totalVotes_ = IKIP7(address(this)).balanceOf(_holder);
        uint256 usingVotes = _getTotalUsingVotes(_holder);
        return totalVotes_.sub(usingVotes);
    }

    function _getTotalUsingVotes(address _holder) internal view returns(uint256 totalUsingVote_) {
        totalUsingVote_ = LibDiamond.getUint(keccak256(abi.encode(VFINIX_TOTAL_USE,_holder)));
    }

    function _setTotalUsingVotes(address _holder,uint256 _votes) internal {
        LibDiamond.setUint(keccak256(abi.encode(VFINIX_TOTAL_USE,_holder)),_votes);
    }
}
